type TypeGuard<T> = (value: any, ...rest: Array<unknown>) => value is T
type InferType<T extends TypeGuard<any>> = T extends TypeGuard<infer R>
  ? R
  : never

export type Static<T extends Type<any>> = InferType<T['check']>

const joinSummary = (values: Array<string>, conjugnation: string): string => {
  const length = values.length
  switch (length) {
    case 0:
      return ''
    case 1:
      return values[0]
    case 2:
      return `${values[0]} ${conjugnation} ${values[1]}`
  }
  const lastIndex = length - 1
  let result = `${values[0]}`
  let index = 0
  while (++index <= lastIndex) {
    result +=
      index === lastIndex
        ? `, ${conjugnation} ${values[index]}`
        : `, ${values[index]}`
  }
  return result
}

const isBoolean = (value: any): value is boolean => typeof value === 'boolean'
const isString = (value: any): value is string => typeof value === 'string'
const test = (expression: RegExp) => (value: string): value is string => {
  expression.lastIndex = 0
  return expression.test(value)
}

const isNumber = (value: any): value is number =>
  typeof value === 'number' && value === value
const isVoid = (value: any): value is null => value == null
export const equalsWith = (tranform: Function) => (a: any) => tranform(a) === a

const isEmailAddress = test(/.@./)

export default class Type<T> {
  readonly description: string
  readonly check: TypeGuard<T>

  constructor(description: string, typeGuard: TypeGuard<T>) {
    this.description = description
    this.check = typeGuard
  }

  toString(): string {
    return this.description
  }

  and(...types: Array<Type<any>>): Type<any> {
    return Type.and(this, ...types)
  }

  or(...types: Array<Type<any>>) {
    return Type.or(this, ...types)
  }

  static is<T>(description: string, typeGuard: TypeGuard<T>): Type<T> {
    return new Type(description, typeGuard)
  }

  static and<T extends Array<Type<any>>>(...types: T): Type<Static<T[number]>> {
    return Type.is(
      joinSummary((types as unknown) as Array<string>, 'and'),
      (value: any): value is Static<T[number]> =>
        types.every((type) => type.check(value)),
    )
  }

  static or<T extends Array<Type<any>>>(...types: T): Type<Static<T[number]>> {
    return Type.is(
      joinSummary((types as unknown) as Array<string>, 'or'),
      (value: any): value is Static<T[number]> =>
        types.some((type) => type.check(value)),
    )
  }

  static literal<T extends string | number | boolean | null | undefined>(
    literal: T,
  ) {
    return Type.is(
      `equal to ${String(literal)}`,
      (value: any): value is T => value === literal,
    )
  }

  static optional<T>(type: Type<T>): Type<T | null | undefined> {
    return Type.is(
      `${type.description} (optional)`,
      (value: any): value is T | null | undefined =>
        value == null || type.check(value),
    )
  }

  static expression<T extends RegExp>(expression: T): Type<string> {
    return Type.is(
      `a string that matches ${String(expression)}`,
      (value: any): value is string => {
        expression.lastIndex = 0
        return expression.test(value)
      },
    )
  }

  static object<T>(type: Type<T>): Type<Array<T>> {
    return Type.is(
      `an object where each property ${type.description}`,
      (value: any): value is Array<T> => {
        if (value != null) {
          for (const key in value) {
            if (Object.hasOwnProperty.call(value, key)) {
              if (!type.check(value[key])) {
                return false
              }
            }
          }
          return true
        }
        return false
      },
    )
  }

  static array<T>(type: Type<T>): Type<Array<T>> {
    return Type.is(
      `an Array where each element ${type.description}`,
      (value: any): value is Array<T> => {
        if (Array.isArray(value)) {
          for (let i = 0; i < value.length; ++i) {
            if (!type.check(value[i])) {
              return false
            }
          }
          return true
        }
        return false
      },
    )
  }

  static record<T extends Record<string, Type<any>>>(
    rules: T,
  ): Type<{ [K in keyof T]: Static<T[K]> }> {
    const keys = Object.keys(rules)
    const description = keys.map(
      (key) => `'${key}' IS ${rules[key].description}`,
    )
    const typeGuard = (value: any) =>
      value != null && keys.every((key) => rules[key].check(value[key]))
    return Type.is(
      `an object where ${joinSummary(description, 'and')}`,
      typeGuard as any,
    )
  }

  static tuple<T extends TupleType<Type<any>>>(rules: T): Type<T> {
    return Type.is(
      `a tuple of ${rules.length} elements`,
      (value: any): value is T =>
        Array.isArray(value) &&
        value.length === rules.length &&
        rules.every((type, index) => type.check(value[index])),
    )
  }
}

type TupleType<T extends Type<any>> =
  | [Static<T>]
  | [Static<T>, Static<T>]
  | [Static<T>, Static<T>, Static<T>]

type X = TupleType<Type<number>>

const equalWithMathAbs = equalsWith(Math.abs)
const equalWithMathFloor = equalsWith(Math.floor)

export const uint = Type.is(
  'a positive integer',
  (value: any): value is number =>
    isNumber(value) && equalWithMathFloor(value) && equalWithMathAbs(value),
)

export const int = Type.is(
  'a integer',
  (value: any): value is number => isNumber(value) && equalWithMathFloor(value),
)

export const array = Type.is('an Array', Array.isArray)
export const string = Type.is('a string', isString)
export const number = Type.is('a number', isNumber)
export const boolean = Type.is('a boolean', isBoolean)
export const optional = Type.is('null or undefined', isVoid)

type X14 = { [key: string]: any } & {
  test?: never
}

const xafa: X14 = {
  test: undefined,
}
